idx = -1

function get_name() {
  idx = idx + 1;
  return names[idx]
}

function generateEnty(office, rank, parent, data) {
  idx = idx + 1
  id = "_autogen_" + idx.toString(36)

  return {
    entry: {
      office, rank,
      "name": names[idx],
      data,

      id,
      "parentId": parent
    },
    id
  }
}

function getOrdinal(n) {
  let ord = 'th';

  if (n % 10 == 1 && n % 100 != 11)
  {
    ord = 'st';
  }
  else if (n % 10 == 2 && n % 100 != 12)
  {
    ord = 'nd';
  }
  else if (n % 10 == 3 && n % 100 != 13)
  {
    ord = 'rd';
  }

  return n.toString() + ord;
}

function range(n) {
  return [...Array(n).keys()].map(id => id +1)
}

function generateFleet(name, groups, taskForces, divisions, data, parent="NavCom") {
  const {entry: fleet, id: fleetId} = generateEnty(name, "vice Admiral", parent, data);
  return [fleet, ...range(groups).map(idx => generateNavalGroup(idx, fleetId, taskForces, divisions)).flat()]
}

function generateNavalGroup(idx, parent, taskForces, divisions) {
  const {entry: group, id: groupId} = generateEnty(getOrdinal(idx) + " Group", "rear Admiral", parent, "");
  return [group, ...range(taskForces).map(id => generateTaskForce(id + (idx-1) * taskForces, groupId, taskForces, divisions)).flat()]
}

function generateTaskForce(idx, parent, divisions) {
  const {entry: group, id: groupId} = generateEnty(getOrdinal(idx) + " Task Force", "rear Admiral (lower Half)", parent, "");
  return [group, ...range(divisions).map(id => generateDivision(id + idx * divisions, groupId, divisions)).flat()]
}

function generateDivision(idx, parent) {
  const { entry: group } = generateEnty(getOrdinal(idx) + " Division", "Senior Captain", parent, "");
  return [group]
}